<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8" />
    <title>sprite59</title>
</head>
<body>
<canvas id="sprite59" width="100" height="100" style="border:2px solid #cccccc;"></canvas>
<script src=".\sprite59\jaf.js"></script>
<script>
ST('sprite59', function(_f) {
    _f.setFps(25);
    _f.defaults.debug = false;
    _f.loop = true;
    // Create sprite: sprite58
    var sprite58 = new movieclip('sprite58', 1, true);
    var l0 = sprite58.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .shape('shape54', './sprite59/shape54.svg', 'svg', 0, 0, 1, 0)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0]);

    var l1 = sprite58.layer('l1', 1);
    l1.frameclip('t0', 0, 0, 1)
    .shape('shape57', './sprite59/shape57.svg', 'svg', 0, 0, 1, 0)
    .track('mx')
    .key(0, [1, 0, 0, 1, 0, 0]);


    // Create sprite: mm
    var mm = new movieclip('mm', 1, true);
    var l0 = mm.layer('l0', 0);
    l0.frameclip('t0', 0, 0, 1)
    .sprite('sprite58', sprite58)
    .track('mx')
    .key(0, [1, 0, 0, 1, 50, 50]);

    var l1 = mm.layer('l1', 1);


    _f.mc(mm);
    _f.start();
});
</script>
</body>
</html>
